          if (it.size > 1) {
            callback(
                Result.failure(
                    ProxyApiTestsError(it[0] as String, it[1] as String, it[2] as String?)))
          } else {
            callback(Result.success(Unit))
          }
        } else {
          callback(Result.failure(ProxyApiTestsGolubetsUtils.createConnectionError(channelName)))
        }
      }
    }
  }
}
